import React, { useState } from 'react';

function Tasks(){

    const dates = [1,2,3,4,5,6,7];
    const months = ["jan", "feb", "march"];
    const arr = [];
    var count = 0;

    function getArr(){
        for(let i = 0; i <months.length; i++){
            for(let j = 0; j<dates.length; j++){
                arr.push(dates[j] + " " + months[i]);    
                arr.push("");
            }
        }  
    }

    return(
        <div className = "tasks">
            {getArr()}
            {arr.map((e) =>{return <li>{e}</li>})}
        </div>
    );

}

